import React from "react";

function Home() {
  return (
    <section id="home" className="relative bg-[#0f0f0f] text-white min-h-screen flex flex-col justify-center items-center">
      <div className="text-center">
        {/* Logo */}
        <img
          src="./img/logo.jpg" // Replace with the correct path to your logo
          alt="Logo"
          className="w-48 h-48 mb-8 mx-auto" // Reduced size for better balance
        />
        {/* Welcome Text */}
        <h1 className="text-6xl font-bold text-[#ffcc70]">Welcome to Our Portfolio</h1>
      </div>
    </section>
  );
}

export default Home;
